import axios from "axios";
import {useEffect, useState} from "react";

function App() {

  const [info, setInfo] = useState([])
    axios.get('https://fortnite-api.com/v1/map')
        .then(res => res.json())
        .then(data => setInfo(data))


  return(
      <div className="all-items">

      </div>
  )
}

export default App;
